// src/functions.ts
async function get_prompt(body) {
  const prompt = body.split("&")[2].split("=")[1];
  return prompt;
}
async function clean(body) {
  body = body.replace(/%40/g, "@");
  body = body.replace(/%2B/g, "+");
  body = body.replace(/%20/g, " ");
  body = body.replace(/%3F/g, "?");
  body = body.replace(/%2C/g, ",");
  body = body.replace(/%C3%A9/g, "\xE9");
  body = body.replace(/%C3%AD/g, "\xED");
  body = body.replace(/%C3%B3/g, "\xF3");
  body = body.replace(/%C3%BA/g, "\xFA");
  body = body.replace(/%C3%81/g, "\xC1");
  body = body.replace(/%C3%89/g, "\xC9");
  body = body.replace(/%C3%8D/g, "\xCD");
  body = body.replace(/%C3%93/g, "\xD3");
  body = body.replace(/%C3%9A/g, "\xDA");
  return body;
}

// index.ts
var fs = (()=>({}));
var dotenv3 = require_main();
dotenv3.config();
var ADMIN_TOKEN = process.env.ADMIN_TOKEN;
var server = Bun.serve({
  fetch: async (req) => {
    const url = new URL(req.url);
    if (url.pathname === "/") {
      return new Response("Hello World!");
    }
    if (url.pathname === "/chat_stream") {
      let body = await req.text();
      body = await clean(body);
      const status = await auth_user(body);
      if (status === false) {
        return new Response("404");
      }
      const prompt = await get_prompt(body);
      console.log(body);
      const response = chat(prompt);
      let value = await response.next();
      const chat_response = new ReadableStream({
        type: "direct",
        async pull(controller) {
          while (value.done !== true) {
            let mensaje = value.value;
            controller.write(mensaje);
            value = await response.next();
          }
          controller.close();
        }
      });
      return new Response(chat_response);
    }
    if (url.pathname === "/chat_simple") {
      const body = await req.text();
      console.log(body);
      const status = await auth_user(body);
      if (status === false) {
        return new Response("404");
      }
      const prompt = await get_prompt(body);
      console.log(body);
      const response = await simple_chat(prompt);
      console.log(response);
      return new Response(response);
    }
    if (url.pathname === "/auth") {
      let body = await req.text();
      const status = await auth_user(body);
      if (status === false) {
        return new Response("404");
      }
      return new Response("200");
    }
    if (url.pathname === "/create_user") {
      try {
        const body = await req.text();
        const name = body.split("&")[0].split("=")[1];
        const email = body.split("&")[1].split("=")[1];
        const password = body.split("&")[2].split("=")[1];
        const admin_token = body.split("&")[3].split("=")[1];
        if (admin_token !== ADMIN_TOKEN) {
          return new Response("404");
        }
        console.log(name, email, password);
        await createUser(name, email, password);
        await createStats(email, [], 0, 0);
        console.log("Usuario creado con \xE9xito.");
      } catch (error) {
        console.error("Error al crear usuario:", error);
      }
    }
    if (url.pathname === "/add_tokens") {
      try {
        const body = await req.text();
        const user = body.split("&")[0].split("=")[1];
        const tokens = parseInt(body.split("&")[1].split("=")[1]);
        const admin_token = body.split("&")[2].split("=")[1];
        if (admin_token !== ADMIN_TOKEN) {
          return new Response("404");
        }
        await add_tokens_credit(user, tokens);
        console.log("Tokens a\xF1adidos con \xE9xito.");
      } catch (error) {
        console.error("Error al a\xF1adir tokens:", error);
      }
    }
    return new Response("404!");
  },
  port: 3000
});
console.log(`Listening on http://localhost:${server.port} ...`);
